import { useEffect, useState } from 'react';
import './App.css';
import ArtistList from './components/ArtistList.js';
import AlbumList from './components/AlbumList.js';
import GenreList from './components/GenreList.js';


function App() {

    const [page, setPage] = useState(1);
    const [where, setWhere] = useState('homepage');

    function prevPage() {
        if (page === 1) {
            return;
        }
        setPage(page - 1);
    }

    function nextPage() {
        setPage(page + 1);
    }

    switch (where){}
    return (
        <>
            <div class="navbar">
                <li><button class="nav-links" onClick={()=>{setWhere('homepage')}}>HOMEPAGE</button></li>
                <li><button class="nav-links" onClick={()=>{setWhere('artists')}}>ARTISTS</button></li>
                <li><button class="nav-links" onClick={()=>{setWhere('albums')}}>ALBUMS</button></li>
                <li><button class="nav-links" onClick={()=>{setWhere('genres')}}>GENRES</button></li>
            </div>

            <div class='content'><ArtistList /></div>
            <div className='pageDiv'>
              <button className='pageButton' onClick={prevPage}>Previous Page</button>
              <p>Page {page}</p>
              <button className='pageButton' onClick={nextPage}>Next page</button>
            </div>
        </>
    );
    return (
        <>
            <div class="navbar">
                <li><button class="nav-links" onClick={()=>{setWhere('homepage')}}>HOMEPAGE</button></li>
                <li><button class="nav-links" onClick={()=>{setWhere('artists')}}>ARTISTS</button></li>
                <li><button class="nav-links" onClick={()=>{setWhere('albums')}}>ALBUMS</button></li>
                <li><button class="nav-links" onClick={()=>{setWhere('genres')}}>GENRES</button></li>
            </div>

            <div class='content'><AlbumList /></div>
            <div className='pageDiv'>
              <button className='pageButton' onClick={prevPage}>Previous Page</button>
              <p>Page {page}</p>
              <button className='pageButton' onClick={nextPage}>Next page</button>
            </div>
        </>
    );
    return (
        <>
            <div class="navbar">
                <li><button class="nav-links" onClick={()=>{setWhere('homepage')}}>HOMEPAGE</button></li>
                <li><button class="nav-links" onClick={()=>{setWhere('artists')}}>ARTISTS</button></li>
                <li><button class="nav-links" onClick={()=>{setWhere('albums')}}>ALBUMS</button></li>
                <li><button class="nav-links" onClick={()=>{setWhere('genres')}}>GENRES</button></li>
            </div>

            <div class='content'><GenreList /></div>
            <div className='pageDiv'>
              <button className='pageButton' onClick={prevPage}>Previous Page</button>
              <p>Page {page}</p>
              <button className='pageButton' onClick={nextPage}>Next page</button>
            </div>
        </>
    );
    return (
        <>
            <div class="navbar">
                <li><button class="nav-links" onClick={()=>{setWhere('homepage')}}>HOMEPAGE</button></li>
                <li><button class="nav-links" onClick={()=>{setWhere('artists')}}>ARTISTS</button></li>
                <li><button class="nav-links" onClick={()=>{setWhere('albums')}}>ALBUMS</button></li>
                <li><button class="nav-links" onClick={()=>{setWhere('genres')}}>GENRES</button></li>
            </div>

            <div class='content'><Accueil /></div>
            <div className='pageDiv'>
              <button className='pageButton' onClick={prevPage}>Previous Page</button>
              <p>Page {page}</p>
              <button className='pageButton' onClick={nextPage}>Next page</button>
            </div>
        </>
    );
}

export default App;
